import React, { Component } from 'react'
 
import Card from 'react-animated-3d-card'
 
const Cards = () => {
 
    return <>
    <Card       
      style={{
        backgroundColor: 'red',
        width: '450px',
        height: '300px',
        cursor: 'pointer'
      }}
      onClick={() => console.log('Card clicked')}
    />

    <Card       
      style={{
        backgroundColor: 'red',
        width: '450px',
        height: '300px',
        cursor: 'pointer'
      }}
      onClick={() => console.log('Card clicked')}
    />

    <Card       
      style={{
        backgroundColor: 'red',
        width: '450px',
        height: '300px',
        cursor: 'pointer',
        display: 'inline'
      }}
      onClick={() => console.log('Card clicked')}
    />
    </>
  }


export default Cards
